// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ClassroomAttendance {
    // Teacher's address
    address public teacher;

    struct Student {
        string name;
        bool attendance;
    }

    // Mapping to store student records by roll number
    mapping(uint => Student) public studentRecords;
    uint[] public rollNumbers; // To keep track of all roll numbers

    // Event to log attendance
    event AttendanceMarked(uint rollNumber, string name);

    // Constructor sets the teacher
    constructor() {
        teacher = msg.sender;

        rollNumbers.push(1);
        studentRecords[1] = Student("John Doe", false);

        rollNumbers.push(2);
        studentRecords[2] = Student("Jane", false);

        rollNumbers.push(3);
        studentRecords[3] = Student("Mary", false);
    }

    // Modifier to restrict access to teacher
    modifier onlyTeacher() {
        require(msg.sender == teacher, "Only the teacher can perform this action");
        _;
    }

    // Function to mark attendance (only teacher can call)
    function markAttendance(uint _rollnumber) public onlyTeacher {

        require(_rollnumber < rollNumbers.length, "Student not found");

        Student storage _student = studentRecords[_rollnumber];

        require(!_student.attendance, "Student already marked present");
        _student.attendance = true;

        emit AttendanceMarked(_rollnumber, _student.name);
    }

    // Function to check if a student has attended
    function hasAttended(uint _rollnumber) public view returns (bool) {

        require(_rollnumber < rollNumbers.length, "Student not found");
        return studentRecords[_rollnumber].attendance;
    }

    // Function to get total number of students
    function getTotalStudents() public view returns (uint) {
        return rollNumbers.length;
    }
}

